		"ЁУЖЙ рд╢рд╛рдпрдж рдореИрдВрдиреЗ рддреБрдореНрд╣реЗрдВ рдмрд╣реБрдд рдЬрд╝реНрдпрд╛рджрд╛ рдкреНрдпрд╛рд░ рдХрд┐рдпрд╛ ЁУГФ рдФрд░ рдлрд┐рд░ рдорд╣рд╕реВрд╕ рдХрд┐рдпрд╛ ЁУГм рддреБрдордиреЗ рдореБрдЭреЗ рдХрдбрд╝рд╡рд╛рд╣рдЯ рджреА ЁУАБ рдФрд░ рд╢рд╛рдпрдж рдореИрдВрдиреЗ рддреБрдореНрд╣реЗрдВ рдмрд╣реБрдд рдЬрд╝реНрдпрд╛рджрд╛ рдЪрд╛рд╣рд╛ ЁУЖд рдЕрдм рдХреЗрд╡рд▓ рд╢реВрдиреНрдп рд╣реИ ЁУБФ рдореИрдВ рдЙрди рдорд╣реАрдиреЛрдВ рдФрд░ рджрд┐рдиреЛрдВ рдХреЛ рджрдлрди рдХрд░рдирд╛ рдЪрд╛рд╣рддрд╛ рд╣реВрдБ ЁУЕД рддреБрдо рдореБрдЭрд╕реЗ рджреВрд░ рдЪрд▓реА рдЧрдИрдВ ЁУГ╣ рдПрдХ рдмрд╛рд░рд┐рд╢ рднрд░реА рджреЛрдкрд╣рд░ рдореЗрдВ ЁУВДЁУЖйЁСБНЁУЖкЁУВБ рдореЗрд░реЗ рдкреНрдпрд╛рд░ рдХреЛ ЁУЕЛ рдмрд╛рджрд▓реЛрдВ рдХреЗ рд╕рд╛рде рдЧреАрдд рдореЗрдВ рдорд┐рд▓рд╛ рджреЛ ЁУГа рдЙрди рджрд┐рдиреЛрдВ рдХреЛ рднреВрд▓ рдЬрд╛рдУ ЁУГЯ рдЬреЛ рдореЗрд░реЗ рджрд┐рд▓ рдореЗрдВ рдмрд╛рдХреА рд╣реИрдВ ЁУЕШ рдореИрдВ рдЬрд╛рдирддрд╛ рд╣реВрдБ рдХрд┐ рд╕рдЪреНрдЪрд╛рдИ ЁУЕХ рдореЗрд░реЗ рд▓рд┐рдП рдирд╣реАрдВ рд╣реИ т╕Щ",

		"ЁУВДЁУЖйЁСБНЁУЖкЁУВБ рдХреБрдЫ рдардВрдбреА рд╕рд░реНрджрд┐рдпреЛрдВ рдХреЗ рджрд┐рди, рд▓реЗрдХрд┐рди рдкрд┐рддрд╛ рдЕрднреА рддрдХ рдирд╣реАрдВ рд▓реМрдЯреЗ ЁУБП рдорд╛рдБ рдореБрд╕реНрдХреБрд░рд╛рддреА рд╣реИрдВ, рд▓реЗрдХрд┐рди рдореБрдЭреЗ рдкрддрд╛ рд╣реИ рдорд╛рдБ рдмрд╣реБрдд рдЪрд┐рдВрддрд┐рдд рд╣реИрдВ, рдкрд┐рддрд╛ ЁУЕС рд╡рд╕рдВрдд рддрдм рдЖрдПрдЧрд╛ рдЬрдм рдореИрдВ рд╡реЛ рдкрд░рд┐рдЪрд┐рдд рдЧрд╛рдбрд╝реА рдХреА рдЖрд╡рд╛рдЬрд╝ рд╕реБрдиреВрдБрдЧрд╛ ЁУГж рдмрдЪрдкрди, рдореБрдЭреЗ рд╡реЛ рдордЫрд▓реА рдХреЗрдХ рдмрд╣реБрдд рдпрд╛рдж рдЖрддреЗ рд╣реИрдВ рдЬрд┐рдирдХреЗ рд╕рд╛рде рдореИрдВ рдмрдбрд╝рд╛ рд╣реБрдЖ ЁУАа рд╕рдордп рдмреАрддрддрд╛ рдЧрдпрд╛, рдореИрдВ рдмрдбрд╝рд╛ рд╣реБрдЖ, рдореБрдЭреЗ рдкрддрд╛ рд╣реИ рдореЗрд░рд╛ рд╕рдкрдирд╛ рдХреНрдпрд╛ рд╣реИ ЁУЕУ рдЕрдкрдиреЗ рдЬреБрдиреВрди рдХреЗ рдкреАрдЫреЗ рднрд╛рдЧрддреЗ рд╣реБрдП, рдореБрдЭреЗ рдбрд░ рд╣реИ рдХрд┐ рдореИрдВ рдЕрдкрдиреЗ рдЧрд╛рдБрд╡ рдХреЛ рднреВрд▓ рдЬрд╛рдКрдБрдЧрд╛ ЁУВДЁУЖйЁСБНЁУЖкЁУВБ",

		"ЁУВД рдореИрдВ рд╡рд╣рд╛рдБ рджреЗрдЦрддрд╛ рд╣реВрдБ ЁУЕГ рд▓реЗрдХрд┐рди рддреБрдореНрд╣рд╛рд░реЗ рд╣реЛрдВрдареЛрдВ рдкрд░ рддрд╛рдЬрд╝рд╛ рд▓рд┐рдкрд╕реНрдЯрд┐рдХ рдХреЗ рдирд┐рд╢рд╛рди рдирд╣реАрдВ рджрд┐рдЦрддреЗ, рдЬрд┐рд╕ рджрд┐рди рддреБрдо рдЪрд▓реА рдЧрдИрдВ ЁУЖг рдЬрдм рдмрд╣реБрдд рд╕рд╛рд░реА рдореБрд╢реНрдХрд┐рд▓реЗрдВ рдереАрдВ, рддреБрдордиреЗ рдХрд╣рд╛ рдерд╛ рдХрд┐ рддреБрдо рд╕рд░реНрджреА рдЦрддреНрдо рд╣реЛрдиреЗ рдкрд░ рд▓реМрдЯреЛрдЧреА ЁУЖП рдореИрдВ рддреБрдореНрд╣реЗрдВ рдпрд╛рдж рдХрд░рддрд╛ рд╣реВрдБ рдЬрдм рд▓рдВрдмреА рдардВрдбреА рдмрд╛рд░рд┐рд╢ рдирд╣реАрдВ рд░реБрдХрддреА ЁУЗ╗ рдореИрдВ рддреБрдореНрд╣реЗрдВ рдпрд╛рдж рдХрд░рддрд╛ рд╣реВрдБ рдЬрдм рддреБрдордиреЗ рдореБрдЭреЗ рдЧрд▓реЗ рд▓рдЧрд╛рдпрд╛ рдФрд░ рд░реЛрдпрд╛ ЁУГ░ рдореИрдВ рддреБрдореНрд╣реЗрдВ рдпрд╛рдж рдХрд░рддрд╛ рд╣реВрдБ рдЬрдм рдореЗрд░реЗ рдХрдВрдзреЛрдВ рдкрд░ рдХрдИ рдЪрд┐рдВрддрд╛рдПрдБ рдереАрдВ ЁУДА рдореИрдВ рддреБрдореНрд╣реЗрдВ рдпрд╛рдж рдХрд░рддрд╛ рд╣реВрдБ рдЬрдм рдЪрд╛рдБрдж рдирд┐рдХрд▓рд╛ рдФрд░ рд░рд╛рдд рджрд┐рди рд╕реЗ рд▓рдВрдмреА рд╣реЛ рдЧрдИ ЁУЕе",

		"ЁУВДЁУЖйЁСБНЁУЖкЁУВБ рдореЗрд░реА рдмрд╛рд╣реЗрдВ рдЬреЛ рддреБрдореНрд╣реЗрдВ рдкрд╣рд▓реЗ рдЧрд▓реЗ рд▓рдЧрд╛рддреА рдереАрдВ, рдЕрдм рдХрд┐рд╕реА рдФрд░ рдХреЗ рд▓рд┐рдП рд╣реИрдВ ЁУЕЗ рддреБрдореНрд╣рд╛рд░реЗ рд╣реЛрдВрдареЛрдВ рдХреА рдЪрд╛рдп рдХреА рдЦреБрд╢рдмреВ рдореБрдЭреЗ рдордВрддреНрд░рдореБрдЧреНрдз рдХрд░рддреА рдереА, рд▓реЗрдХрд┐рди рдХрд┐рд╕реА рдФрд░ рдХреЗ рд╕рд╛рде рднреА рдРрд╕рд╛ рд╣реА рд╣реИ ЁУЖЙ рдЕрдкрдиреЗ рдзреЛрдЦреЗ рдХреЗ рд▓рд┐рдП рдорд╛рдлреА рдордд рдорд╛рдБрдЧреЛ, рддреБрдордиреЗ рдкрд╣рд▓реЗ рд╣реА рдРрд╕рд╛ рдХрд░ рд▓рд┐рдпрд╛ ЁУЗ╗ рд╣рдо рдЧрд▓рддрд┐рдпрд╛рдБ рдЬрд╛рд░реА рдирд╣реАрдВ рд░рдЦ рд╕рдХрддреЗ ЁУГ░ рдЙрд╕рдХреЗ рдкрд╛рд╕ рд▓реМрдЯ рдЬрд╛рдУ, рд╣рдорд╛рд░реЗ рдкреБрд░рд╛рдиреЗ рдкреНрдпрд╛рд░ рдХреЛ рдорд┐рдЯрд╛ рджреЛ ЁУЖП рдореИрдВ рдЪреБрдкрдЪрд╛рдк рддреБрдореНрд╣рд╛рд░реЗ рд▓рд┐рдП рдЦреБрд╢реА рдХреА рдХрд╛рдордирд╛ рдХрд░реВрдБрдЧреА ЁУВДЁУЖйЁСБНЁУЖкЁУВБ",

