		"ЁУВДЁУЖйЁСБНЁУЖкЁУВБ рдореЗрд░реЗ рд╕рд╛рде рдорд╣рд╛рд╕рд╛рдЧрд░реЛрдВ рдХреЛ рдкрд╛рд░ рдХрд░реЛ, рдореЗрд░реЗ рд╕рд╛рде рд╣рдЬрд╝рд╛рд░ рд░рд╛рд╕реНрддреЛрдВ рдкрд░ рдЪрд▓реЛ, рдмрд╛рджрд▓реЛрдВ рдХреА рддрд░рд╣ рд╕реНрд╡рддрдВрддреНрд░, рдиреАрд▓реЗ рдЖрд╕рдорд╛рди рдХреА рддрд░рд╣ рд╕рдкрдиреЗ, рдЬрд╝рд┐рдВрджрдЧреА рд╡реИрд╕реА рд╣реА рд░рд╣рддреА рд╣реИ, рдорд╣реАрдиреЗ рдФрд░ рд╕рд╛рд▓ рдмреАрддрддреЗ рд░рд╣рддреЗ рд╣реИрдВ, рдЪрд╛рд╣реЗ рдмрд╛рд░рд┐рд╢ рд╣реЛ рдпрд╛ рдзреВрдк, рд╣рдо рд╕рд╛рде рд╣реЛрдВрдЧреЗ, рддреБрдореНрд╣рд╛рд░рд╛ рд╣рд╛рде рдФрд░ рдХрд╕рдХрд░ рдкрдХрдбрд╝реВрдБрдЧрд╛ рддрд╛рдХрд┐ рд╣рдо рдХрднреА рди рдмрд┐рдЫрдбрд╝реЗрдВ, рдЪрд╛рд╣реЗ рдХрд▓ рд╣рдореЗрдВ рдХрд╣реАрдВ рд▓реЗ рдЬрд╛рдП, рдореЗрд░реЗ рдкреАрдЫреЗ рдЫрд┐рдк рдЬрд╛рдУ, рд╕рд╛рд░реА рдЪрд┐рдВрддрд╛рдПрдБ рд╣рд▓реНрдХреА рд╣реЛ рдЬрд╛рдПрдБрдЧреА рдЬреИрд╕реЗ рдмрд╛рджрд▓ рдЙрдбрд╝рддреЗ рд╣реИрдВ ЁУВДЁУЖйЁСБНЁУЖкЁУВБ",

